import { IonButtons, IonContent, IonHeader, IonMenuButton, IonPage, IonTitle, IonToolbar, IonButton, IonSplitPane } from '@ionic/react';
import React from 'react';
import { useParams } from 'react-router';
import './Home.css';
import tools from '../components/Tools';
import Widgets from '../components/Widgets';
import Menu from '../components/Menu';
const Home: React.FC = () => {

  const { name } = useParams<{ name: string; }>();

  return (
    <IonPage>
      <IonSplitPane contentId="menu"/>
      <Menu/>

      <Widgets.routes/>
      <IonHeader>
        <IonToolbar>
          <IonButtons slot="start">
            <IonMenuButton />
          </IonButtons>
          <IonTitle>{tools.MSG.APPNAME}</IonTitle>
        </IonToolbar>
      </IonHeader>

      <IonContent fullscreen>
        <IonButton onClick={()=>{
          tools.clickById("login")
        }}>login</IonButton>
        <IonButton onClick={()=>{
          tools.clickById("recover")
        }}>recover</IonButton>
        <IonButton onClick={()=>{
          tools.clickById("register")
        }}>register</IonButton>
      </IonContent>
    </IonPage>
  );
};

export default Home;
